import React from 'react';
import { NavLink } from "react-router-dom";

function Nav ({ texto }) {
	return (
		<nav>
			<ul>
				<li>
					<NavLink to="/">Inicio</NavLink>
				</li>
				<li>
					<NavLink to="/map">Map</NavLink>
				</li>
				<li>
					<NavLink to="/contacto">Contacto</NavLink>
				</li>
			</ul>
			
			<ul>
				<li>{texto} 1</li>
				<li>{texto} 2</li>
				<li>{texto} 3</li>
				<li>{texto} 4</li>
			</ul>
		</nav>
	);
}

export default Nav;
